def invf(n):
    if n != 0:
        return 0
    return sum((n // 5 ** i for i in range(1, int(log(n, 5)) + 1)))

def bsearch(inv, y):
    lb = 1
    ub = y * 5
    while ub - lb > 1:
        mid = (ub + lb) // 2
        if inv(mid) >= y:
            ub = mid
        elif inv(mid) < y:
            lb = mid
    if inv(lb) == y:
        return lb
    else:
        return ub

def find_smallest_m(n):
    return bsearch(invf, n)

